"""# Graph exploration/connected components via Full-BFS and Full-DFS"""

from collections import defaultdict, deque

class Graph:
    def __init__(self):
        self.graph = defaultdict(list)

    def add_edge(self, u, v):
        self.graph[u].append(v)
        self.graph[v].append(u)  # Assuming undirected graph

    def full_bfs(self):
        visited = set()
        components = []

        for vertex in self.graph:
            if vertex not in visited:
                component = []
                queue = deque([vertex])
                visited.add(vertex)

                while queue:
                    current_vertex = queue.popleft()
                    component.append(current_vertex)

                    for neighbor in self.graph[current_vertex]:
                        if neighbor not in visited:
                            queue.append(neighbor)
                            visited.add(neighbor)

                components.append(component)

        return components

    def full_dfs_util(self, vertex, visited, component):
        visited.add(vertex)
        component.append(vertex)

        for neighbor in self.graph[vertex]:
            if neighbor not in visited:
                self.full_dfs_util(neighbor, visited, component)

    def full_dfs(self):
        visited = set()
        components = []

        for vertex in self.graph:
            if vertex not in visited:
                component = []
                self.full_dfs_util(vertex, visited, component)
                components.append(component)

        return components

# Example usage:
graph = Graph()
graph.add_edge(0, 1)
graph.add_edge(0, 2)
graph.add_edge(1, 2)
graph.add_edge(3, 4)

print("Connected components using Full-BFS:")
print(graph.full_bfs())

print("\nConnected components using Full-DFS:")
print(graph.full_dfs())

"""#Topological sort and Cycle detection via DFS"""

from collections import defaultdict

class Graph:
    def __init__(self):
        self.graph = defaultdict(list)

    def add_edge(self, u, v):
        self.graph[u].append(v)

    def topological_sort_util(self, vertex, visited, stack):
        visited.add(vertex)

        for neighbor in self.graph[vertex]:
            if neighbor not in visited:
                self.topological_sort_util(neighbor, visited, stack)

        stack.append(vertex)

    def topological_sort(self):
        visited = set()
        stack = []

        for vertex in self.graph:
            if vertex not in visited:
                self.topological_sort_util(vertex, visited, stack)

        return stack[::-1]

    def is_cyclic_util(self, vertex, visited, recursion_stack):
        visited.add(vertex)
        recursion_stack.add(vertex)

        for neighbor in self.graph[vertex]:
            if neighbor not in visited:
                if self.is_cyclic_util(neighbor, visited, recursion_stack):
                    return True
            elif neighbor in recursion_stack:
                return True

        recursion_stack.remove(vertex)
        return False

    def is_cyclic(self):
        visited = set()
        recursion_stack = set()

        for vertex in self.graph:
            if vertex not in visited:
                if self.is_cyclic_util(vertex, visited, recursion_stack):
                    return True

        return False

# Example usage:
graph = Graph()
graph.add_edge(0, 1)
graph.add_edge(0, 2)
graph.add_edge(1, 2)
graph.add_edge(2, 3)
graph.add_edge(3, 0)

print("Topological sort:")
print(graph.topological_sort())

print("\nCycle detection:")
print(graph.is_cyclic())

"""#Negative-weight cycle detection via Bellman-Ford"""

class Graph:
    def __init__(self, vertices):
        self.V = vertices
        self.graph = []

    def add_edge(self, u, v, w):
        self.graph.append([u, v, w])

    def bellman_ford(self, src):
        dist = [float("Inf")] * self.V
        dist[src] = 0

        for _ in range(self.V - 1):
            for u, v, w in self.graph:
                if dist[u] != float("Inf") and dist[u] + w < dist[v]:
                    dist[v] = dist[u] + w

        for u, v, w in self.graph:
            if dist[u] != float("Inf") and dist[u] + w < dist[v]:
                return True  # Negative cycle found

        return False  # No negative cycle found

# Example usage:
g = Graph(5)
g.add_edge(0, 1, -1)
g.add_edge(0, 2, 4)
g.add_edge(1, 2, 3)
g.add_edge(1, 3, 2)
g.add_edge(1, 4, 2)
g.add_edge(3, 2, 5)
g.add_edge(3, 1, 1)
g.add_edge(4, 3, -3)

if g.bellman_ford(0):
    print("Graph contains negative weight cycle")
else:
    print("Graph doesn't contain negative weight cycle")


