"""#Single Source Shortest Paths (SSSP) - (With Djikstra Algo.)"""

import heapq

class Graph:
    def __init__(self, vertices):
        self.V = vertices
        self.graph = [[] for _ in range(vertices)]

    def add_edge(self, u, v, w):
        self.graph[u].append((v, w))

    def dijkstra(self, src):
        dist = [float('inf')] * self.V
        dist[src] = 0
        pq = [(0, src)]

        while pq:
            distance, node = heapq.heappop(pq)
            if distance > dist[node]:
                continue

            for neighbor, weight in self.graph[node]:
                if dist[node] + weight < dist[neighbor]:
                    dist[neighbor] = dist[node] + weight
                    heapq.heappush(pq, (dist[neighbor], neighbor))

        return dist

# Example usage:
g = Graph(5)
g.add_edge(0, 1, 10)
g.add_edge(0, 2, 5)
g.add_edge(1, 2, 2)
g.add_edge(1, 3, 1)
g.add_edge(2, 1, 3)
g.add_edge(2, 3, 9)
g.add_edge(2, 4, 2)
g.add_edge(3, 4, 4)
g.add_edge(4, 3, 6)

source = 0
shortest_distances = g.dijkstra(source)
for i, distance in enumerate(shortest_distances):
    print(f"Shortest distance from node {source} to node {i}: {distance}")

"""#All Pairs Shortest Paths (APSP)"""

class Graph:
    def __init__(self, vertices):
        self.V = vertices
        self.graph = [[float('inf')] * vertices for _ in range(vertices)]
        for i in range(vertices):
            self.graph[i][i] = 0

    def add_edge(self, u, v, w):
        self.graph[u][v] = w

    def floyd_warshall(self):
        dist = [row[:] for row in self.graph]

        for k in range(self.V):
            for i in range(self.V):
                for j in range(self.V):
                    if dist[i][k] != float('inf') and dist[k][j] != float('inf'):
                        dist[i][j] = min(dist[i][j], dist[i][k] + dist[k][j])

        return dist

# Example usage:
g = Graph(4)
g.add_edge(0, 1, 5)
g.add_edge(0, 2, 9)
g.add_edge(0, 3, 4)
g.add_edge(1, 2, 2)
g.add_edge(2, 3, 3)

all_pairs_shortest_paths = g.floyd_warshall()
for i in range(len(all_pairs_shortest_paths)):
    for j in range(len(all_pairs_shortest_paths[i])):
        print(f"Shortest distance from node {i} to node {j}: {all_pairs_shortest_paths[i][j]}")

"""#Johnson's Algorithm"""

from heapq import heappop, heappush
from collections import defaultdict

class Graph:
    def __init__(self, vertices):
        self.V = vertices
        self.graph = []

    def add_edge(self, u, v, w):
        self.graph.append([u, v, w])

    def bellman_ford(self, src):
        dist = [float('inf')] * (self.V + 1)
        dist[src] = 0

        for _ in range(self.V):
            for u, v, w in self.graph:
                if dist[u] != float('inf') and dist[u] + w < dist[v]:
                    dist[v] = dist[u] + w

        return dist

    def dijkstra(self, src, dist):
        heap = [(0, src)]
        while heap:
            cost, u = heappop(heap)
            for edge in self.graph:
                if edge[0] == u:
                    v, w = edge[1], edge[2]
                    alt = cost + w
                    if alt < dist[v]:
                        dist[v] = alt
                        heappush(heap, (alt, v))

    def johnson(self):
        s = self.V
        self.graph.extend([[s, i, 0] for i in range(self.V)])

        h = self.bellman_ford(s)
        if any(h):
            return "Graph contains negative cycle"

        self.graph.pop()

        graph_adj = defaultdict(list)
        for u, v, w in self.graph:
            graph_adj[u].append((v, w + h[u] - h[v]))

        shortest_paths = []
        for i in range(self.V):
            dist = [float('inf')] * self.V
            self.dijkstra(i, dist)
            shortest_paths.append([d + h[i] - h[j] for j, d in enumerate(dist)])

        return shortest_paths

# Example usage:
g = Graph(4)
g.add_edge(0, 1, 5)
g.add_edge(0, 2, 9)
g.add_edge(0, 3, 4)
g.add_edge(1, 2, 2)
g.add_edge(2, 3, 3)

shortest_paths = g.johnson()
for i in range(len(shortest_paths)):
    for j in range(len(shortest_paths[i])):
        print(f"Shortest distance from node {i} to node {j}: {shortest_paths[i][j]}")